After The Fire - Der Kommissar [promo].VOB


HQ rare promo music video. &quot;Der Kommissar (The Commissioner)&quot; is a song first recorded by Falco in German in 1981, covered a year later by After the Fire and reworked in 1983 by Laura Branigan. Originally written by Robert Ponger and Falco, the Falco version reached the top of the charts in many countries.

After the Fire's version featured English lyrics by the band's Andy Piercy. The song peaked at #5 on the Billboard Hot 100 charts.

After the Fire (or ATF) are a British rock band that progressed from playing progressive rock to New Wave over their initial 12 year career, while having only one hit in the United States, (&quot;Der Kommissar&quot;) and one hit in the United Kingdom (&quot;One Rule For You&quot;).
